import React from 'react';
import "./chatBox.css"


  const demos = {
    chat:
      "<iframe src='https://webchat.botframework.com/embed/basepreguntaschatbot-bot?s=KK2rQKfaorc.ilCUxtk3Hk21X7NE8mwL5JBsx8pkKc6dXtA7fg3epQ8'  style='min-width: 400px; width: 100%; min-height: 500px;'></iframe>",
  };
  
  //codesandbox.io/s/react-iframe-demo-g3vst codePen =
  function Iframe(props) {
    return (
      <div
        dangerouslySetInnerHTML={{ __html: props.iframe ? props.iframe : "" }}
      />
    );
  }
    
const Chatbox =(props) => {

    return (
        <div className="Box">
        <Iframe iframe={demos["chat"]} allow="autoplay" />,
        </div>
    );
}

export default Chatbox;
